import {Card, Form, Input, Button, Row, Typography, Col } from 'antd'
import React, {useState} from 'react'
import styled from 'styled-components'
import MasterSeatsCard from '../../components/MasterSeatsCard'
import OpenPage from '../OpenPage'
import Navbar from '../Navbar'
import {OuterContainer, CardButton, CardContainer} from '../Card.styled'

const TextContainer = styled(Typography.Text)`
    display: flex;
    flex-direction: column;
    text-align: center;
    padding-bottom: 56px;
    font-family: 'Mark Pro';
    padding-right: 25px;
    padding-left: 25px;
`

interface ResetFormProps {
    onFinish: (values) => void
}

const ResetForm: React.FC<ResetFormProps> = props => {
    const {onFinish} = props
    return (
        <Form
            hideRequiredMark={true}
            name="basic"
            initialValues={{ remember: true }}
            onFinish={onFinish}
        >
            <TextContainer>
                <Typography.Text>Let's reset your password.</Typography.Text>
            </TextContainer>
            <Form.Item
                label="New Password"
                name="new_password"
                rules={[{ required: true, message: 'New Password is required' }]}
            >
                <Input placeholder="password1234"/>
            </Form.Item>
            <Form.Item
                label="Repeat Password"
                name="repeat_password"
                rules={[{ required: true, message: 'Repeat New Password is required' }]}
            >
                <Input placeholder="password1234"/>
            </Form.Item>

            <Form.Item>
                <Row justify="center">
                    <CardButton type="primary" htmlType="submit">
                        Reset
                    </CardButton>
                </Row>
            </Form.Item>
        </Form>
    )
}

export default ResetForm
